import {
  Container,
  Row,
  Col,
  Alert,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";

// Layout
import Layout from "../../components/Layout";
import StoryLayout from "./StoryLayout";

const Garbancito = props => (
  <Layout>
    <Breadcrumb>
      <BreadcrumbItem>
        <a href="/">Home</a>
      </BreadcrumbItem>
      <BreadcrumbItem>
        <a href="../short-stories">Short Stories</a>
      </BreadcrumbItem>
      <BreadcrumbItem active>Garbancito</BreadcrumbItem>
    </Breadcrumb>
  </Layout>
);

export default Garbancito;
